import React from "react";
import "./../components/CardCours.css";
import DataSlidebar from "../DataSlidebar.json";

const CardCours = () => {

  const listeCours = DataSlidebar.DeuxiemeAc.map((it) => (
    <div key={it.title}  className="flex-container">
      <div className="card mb-4 ">
        <div className="card-body">
          <h3>{it.title}</h3>
        </div>
        <div className="card-footer d-block d-lg-flex align-items-center justify-content-between">
          <div className="card-divider">Cours</div>
          <div className="card-divider">Exercices </div>
          <div className="card-divider">Examens </div>
        </div>
      </div>
    </div>
  ));


  const renderListCours = (it , index) => {
    return(
      <div key={index}  className="flex-container">
      <div className="card mb-4 ">
        <div className="card-body">
          <h3>{it.DeuxiemeAc.title}</h3>
        </div>
        <div className="card-footer d-block d-lg-flex align-items-center justify-content-between">
          <div className="card-divider">Cours</div>
          <div className="card-divider">Exercices </div>
          <div className="card-divider">Examens </div>
        </div>
      </div>
    </div>

    );
  }


  return (
  <div className="hi">
    {DataSlidebar.DeuxiemeAc.map(renderListCours) }
  </div>
  );
};
export default CardCours;
